import{_ as t,c as a,o,ag as s}from"./chunks/framework.CSeR4K32.js";const r="/assets/network-manager.FQoYDS_g.png",i="/assets/network-manager-2.CCHDr0gl.png",n="data:image/png;base64,",l="/assets/import.DbtvcCai.png",d="/assets/settings.Cvu3__Ig.png",c="/assets/settings-2.D7C2mlmg.png",A=JSON.parse('{"title":"Development virtual machine","description":"","frontmatter":{},"headers":[],"relativePath":"developer/vm.md","filePath":"developer/vm.md"}'),p={name:"developer/vm.md"};function h(g,e,m,v,u,f){return o(),a("div",null,e[0]||(e[0]=[s('<h1 id="development-virtual-machine" tabindex="-1">Development virtual machine <a class="header-anchor" href="#development-virtual-machine" aria-label="Permalink to &quot;Development virtual machine&quot;">​</a></h1><p>The Intake24 development virtual machine provides pre-installed dependencies such as the PostgreSQL DBMS and Redis server, a blank system database and a (relatively) recent snapshot of the food database.</p><p>This VM is intended to make getting started with Intake24 development easier, however it is not required to set up a working development environment and all dependencies can be installed manually if preferred.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Note that the VM currently does not include the portion size image database. These files will be added later.</p></div><h2 id="download" tabindex="-1">Download <a class="header-anchor" href="#download" aria-label="Permalink to &quot;Download&quot;">​</a></h2><p>An image of the latest version of the development VM is available for download here:</p><p><a href="https://intake24.s3-eu-west-1.amazonaws.com/vm/Intake24+V4+Dev+Build+f188a1f84a776326.ova" target="_blank" rel="noreferrer">https://intake24.s3-eu-west-1.amazonaws.com/vm/Intake24 V4 Dev Build f188a1f84a776326.ova</a></p><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h2><p>The VM image has been produced using <a href="https://www.virtualbox.org" target="_blank" rel="noreferrer">Oracle VirtualBox</a> v6.0. The VM image format is OVA 2.0 and can technically be used with most VM software, however it has only been tested using VirtualBox and we therefore recommend using VirtualBox.</p><h2 id="installation-to-virtualbox" tabindex="-1">Installation to VirtualBox <a class="header-anchor" href="#installation-to-virtualbox" aria-label="Permalink to &quot;Installation to VirtualBox&quot;">​</a></h2><img src="'+r+'" style="float:right;margin-left:15px;margin-top:15px;border:2px solid lightgrey;"><ol><li>In the main menu of VirtualBox open <code>File &gt; Host Network Manager</code>.</li></ol><div style="clear:both;"></div><img src="'+i+'" style="float:right;margin-left:15px;margin-top:15px;border:2px solid lightgrey;"><ol start="2"><li>In the Host Network Manager window click <code>Create</code>.</li></ol><div style="clear:both;"></div><img src="'+n+'" style="float:right;margin-left:15px;margin-top:15px;border:2px solid lightgrey;"><ol start="3"><li><p>In the Adapter tab at the bottom of the Host Network Manager window, set IPv4 address to <code>192.168.56.1</code> and IPv4 network mask to <code>255.255.255.0</code></p></li><li><p>In the DHCP tab, uncheck <code>Enable DHCP</code>.</p></li></ol><div style="clear:both;"></div><img src="'+l+'" style="float:right;margin-left:15px;margin-top:15px;border:2px solid lightgrey;"><ol start="5"><li>In the main menu of VirtualBox click <code>File &gt; Import Appliance</code>.</li></ol><div style="clear:both;"></div><ol start="6"><li><p>Select the VM image file downloaded from the URL above.</p></li><li><p>Change the name of the VM if you like, but keep the rest of the settings as they are.</p></li></ol><div style="clear:both;"></div><img src="'+d+'" style="float:right;margin-left:15px;margin-top:15px;border:2px solid lightgrey;"><ol start="8"><li>Right-click on the imported VM and select <code>Settings</code></li></ol><div style="clear:both;"></div><ol start="9"><li>Open the <code>Network</code> section and make sure that Adapter 1 is set to <code>NAT</code> and Adapter 2 is set to <code>Host-only adapter</code> attached to the Host Only Network you configured in step 2:</li></ol><p><img src="'+c+'" alt="VM settings"></p><ol start="10"><li>Resolve any other issues with the VM (e.g. video memory usage)</li></ol><h2 id="system-notes" tabindex="-1">System notes <a class="header-anchor" href="#system-notes" aria-label="Permalink to &quot;System notes&quot;">​</a></h2><p>The development VM runs <code>Ubuntu Server 20.04 LTS</code>.</p><h3 id="ssh-access" tabindex="-1">SSH access <a class="header-anchor" href="#ssh-access" aria-label="Permalink to &quot;SSH access&quot;">​</a></h3><p>The VM is configured with a static IP of <code>192.168.56.4</code> accessible via the Host Only Network. You can log into it from your host machine using SSH as <code>intake24</code> using the password <code>intake24</code>. This user has <code>sudo</code> rights.</p><h3 id="postgresql" tabindex="-1">PostgreSQL <a class="header-anchor" href="#postgresql" aria-label="Permalink to &quot;PostgreSQL&quot;">​</a></h3><h4 id="access" tabindex="-1">Access <a class="header-anchor" href="#access" aria-label="Permalink to &quot;Access&quot;">​</a></h4><p>PostgreSQL is running on the standard port (5432) and is accepting connections from any network. SSL is off.</p><p>The Intake24 databases are:</p><ul><li>System database: <code>intake24_system</code>, user <code>intake24</code>, no password.</li><li>Foods database: <code>intake24_foods</code>, user <code>intake24</code>, no password.</li></ul><h4 id="logs" tabindex="-1">Logs <a class="header-anchor" href="#logs" aria-label="Permalink to &quot;Logs&quot;">​</a></h4><p>The PostgreSQL server in the VM is configured to log all queries for debug purposes. The log can be found in:</p><p><code>/var/lib/postgresql/12/main/pg_log</code></p>',42)]))}const x=t(p,[["render",h]]);export{A as __pageData,x as default};
